PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("group_id", "permission_id"));
CREATE TABLE "workshops_role" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL);
CREATE TABLE "workshops_lesson" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL);
CREATE TABLE "workshops_tag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(40) NOT NULL UNIQUE, "details" varchar(100) NOT NULL);
CREATE TABLE "workshops_event_tags" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "event_id" integer NOT NULL REFERENCES "workshops_event" ("id"), "tag_id" integer NOT NULL REFERENCES "workshops_tag" ("id"), UNIQUE ("event_id", "tag_id"));
CREATE TABLE "workshops_person_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "person_id" integer NOT NULL REFERENCES "workshops_person" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("person_id", "permission_id"));
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "workshops_person" ("id"));
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL, UNIQUE ("app_label", "model"));
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL, UNIQUE ("content_type_id", "codename"));
CREATE TABLE "workshops_person_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "person_id" integer NOT NULL REFERENCES "workshops_person" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), UNIQUE ("person_id", "group_id"));
CREATE TABLE "workshops_badge" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(40) NOT NULL, "criteria" varchar(100) NOT NULL, "name" varchar(40) NOT NULL UNIQUE);
CREATE TABLE "workshops_award" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "awarded" date NOT NULL, "badge_id" integer NOT NULL REFERENCES "workshops_badge" ("id"), "event_id" integer NULL REFERENCES "workshops_event" ("id"), "person_id" integer NOT NULL REFERENCES "workshops_person" ("id"), UNIQUE ("person_id", "badge_id"));
CREATE TABLE "workshops_airport" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "iata" varchar(10) NOT NULL UNIQUE, "fullname" varchar(100) NOT NULL UNIQUE, "latitude" real NOT NULL, "longitude" real NOT NULL, "country" varchar(2) NOT NULL);
CREATE TABLE "workshops_task" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "event_id" integer NOT NULL REFERENCES "workshops_event" ("id"), "person_id" integer NOT NULL REFERENCES "workshops_person" ("id"), "role_id" integer NOT NULL REFERENCES "workshops_role" ("id"), UNIQUE ("event_id", "person_id", "role_id"));
CREATE TABLE "workshops_site" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "domain" varchar(100) NOT NULL UNIQUE, "fullname" varchar(100) NOT NULL UNIQUE, "notes" text NOT NULL, "country" varchar(2) NULL);
