CREATE TABLE "workshops_person" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "personal" varchar(100) NOT NULL, "middle" varchar(100) NULL, "family" varchar(100) NOT NULL, "email" varchar(100) NULL UNIQUE, "gender" varchar(1) NULL, "may_contact" bool NOT NULL, "github" varchar(40) NULL UNIQUE, "twitter" varchar(40) NULL UNIQUE, "url" varchar(100) NULL, "username" varchar(40) NOT NULL UNIQUE, "airport_id" integer NULL REFERENCES "workshops_airport" ("id"), "notes" text NOT NULL);
CREATE TABLE "workshops_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start" date NULL, "end" date NULL, "slug" varchar(100) NULL, "reg_key" varchar(20) NULL, "attendance" integer NULL, "admin_fee" decimal NULL, "invoiced" bool NULL, "notes" text NOT NULL, "organizer_id" integer NULL REFERENCES "workshops_site" ("id"), "site_id" integer NOT NULL REFERENCES "workshops_site" ("id"), "url" varchar(100) NULL UNIQUE);
